export default {
	handleDraftApplication: () => {
		storeValue( "vayCountryofRegistration", Table1.selectedRow.CUSTOMER_COUNTRY_CODE);
		storeValue( "vayApplicationIndConstitutionType", Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE);
		storeValue("vayApplicantRole", Table1.selectedRow.CUSTOMER_PARTICIPANT_TYPE);		
		storeValue("vayApplicantJurisdiction",Table1.selectedRow.CUSTOMER_COUNTRY_CODE);
		if (Table1.selectedRow.CUSTOMER_COUNTRY_CODE === 'IN')
			{
				if ( Table1.selectedRow.CUSTOMER_PARTICIPANT_TYPE === 'Financier')
					{
								navigateTo('ShowApplicationDraft',{'currentOID':currentRow.OID , 'fromPage':'India Financier'});			
					}
				else
					{
	 			if (Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE === 'Proprietorship' || 
				Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE === 'partnership') {
			//	storeValue( "vayApplicantJurisdiction", 'IN')
			//showAlert("NonCorp")
			navigateTo('ShowApplicationDraft',{'currentOID':currentRow.OID , 'fromPage':'India - Non Corporate'});
	 		} else if (Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE === 'Public Limited Company' || 
							 Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE === 'LLC' || 
							 Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE === 'LLP') {
		//	storeValue( "vayApplicantJurisdiction", 'IN')
			navigateTo('ShowApplicationDraft',{'currentOID':currentRow.OID , 'fromPage':'India - Corporate'})	
			//navigateTo('', {})
	 			} 
					}
			}
		else {
			//storeValue( "vayApplicantJurisdiction", 'NotIN')
			navigateTo('ShowApplicationDraft',{'currentOID':currentRow.OID , 'fromPage':'All Constitution Foreign'})	
			//navigateTo('All Constitution Foreign', {})
	 }
	},
	editApplicationFormData: () => {		
		// console.log(Table1.selectedRow.CUSTOMER_COUNTRY_CODE);
		// console.log(Table1.selectedRow.CUSTOMER_BUSINESS_CONST_TYPE);
		const appStatus = appsmith.URL.queryParams.paramStatus;
		if(appStatus === 'E_STATUS_INVERIFICATION' || appStatus === 'E_STATUS_INAUTHORISATION' ) {
			storeValue('customerOID', currentRow.OID);
			storeValue('customerJID', currentRow.CUSTOMER_REGISTERED_ENTITY_INDFOREIGN);
			navigateTo('Verification Business KYC');
		} else if(appStatus === 'E_STATUS_DRAFT') {
			this.handleDraftApplication();
		}

		//	navigateTo('ShowApplicationDraftForeign',{"currentOID": currentRow.OID,"fromPage":'Application List View'})	

	},
	 navigateToSigning : () =>
		{
				storeValue('customerOID', currentRow.OID);
				navigateTo('Application Signing', {})
		}

}
